INSERT INTO `courses` (`id`, `title`, `course_img`, `general_description`, `matters`, `for_whom`, `results`, `additional_info`, `language`, `main`) VALUES
(1, 'Wprowadzenie do analizy danych RNA-Seq', , 'Ten kurs stanowi wprowadzenie do tematyki zwizanej z analiz danych RNA-Seq. Pozwala on na zapoznanie si z najwaniejszymi krokami analizy, powszechnie stosowanymi potokami analitycznymi i moliwymi zastosowaniami. W trakcie kursu poruszone zostan zagadnienia kontroli jakoci danych, skadania transkryptomu ab initio oraz de novo, szacowania ekspresji genw i analizy rnicowej.', '1. Krtkie wprowadznie do wysokoprzepustowego sekwencjonowania genomw i transkryptomw.\r\n2. Kontrola jakoci danych.\r\n3. Mapowanie odczytw, obliczanie poziomu ekspresji genw i tranksryptw.\r\n4. Analiza ekspresji rnicowej wraz z tworzeniem wykresw diagnostycznych.\r\n5. Skadanie transkryptomu de novo (niezalene od genomu).\r\n6. Skadanie transkryptomu ab initio (z mapowaniem odczytw do genomu).\r\n7. Adnotacja transkryptomw', 'Ten wprowadzajcy kurs skierowany jest do kadego, kto chce si dowiedzie jak radzi sobie z zestawami wielkoskalowych danych RNA-Seq i poszerza wiedz o istotnych biologicznych aspektach tego zagadnienia. Kurs jest przygotowany pod ktem osb prowadzcych badania w dziedzinach biotechnologii, biologii molekularnej, bioinformatyki i innych nauk biologicznych.', 'Po ukoczeniu kursu uczestnicy powinni posiada wiedz o rdach danych RNA-Seq, formatach danych, by w stanie wykona analiz jakoci tych danych, mapowanie do sekwencji referencyjnej, ocen wartoci ekspresji genw/transkryptw i wykona analiz ekspresji rnicowej wcznie z interpretacj otrzymanych wynikw. Uczestnicy posid rwnie wiedz o metodach skadania transkryptomw i bd w stanie wykorzysta poznane potoki analityczne we wasnych projektach. Dua uwaga zwrcona bdzie na wizualizacj danych, tworzenie wykresw, interpretacj wynikw i radzenie sobie z czsto spotykanymi problemami podczas analizy.', 'Kurs odbdzie si w terminie wskazanym po lewej stronie przycisku \"Zarejestruj si\" w formie webinarium. Wymagane jest posiadanie komputera z systemem Windows, Linux lub Mac OS posiadajcego dostp do internetu. Organizator zastrzega sobie prawo do odwoania kursu nie pniej ni na dwa tygodnie przed dat jego rozpoczcia w przypadku mniej ni 5 uczestnikw.', 'polish', 0x5dd81c503d9492ff005c5f025f5c00489732e21964a4ffe0897ed51dba01594876514cc120660b9f742dead9c0dfeffa);
INSERT INTO `courses` (`id`, `title`, `course_img`, `general_description`, `matters`, `for_whom`, `results`, `additional_info`, `language`, `main`) VALUES
(2, 'Analiza interakcji DNA-biako', , 'Ten kurs stanowi wprowadzenie do tematyki zwizanej z analiz danych ChIP-seq oraz ChIPexo, czyli wysokoprzepustowymi metodami badania interakcji biaek z DNA. Kurs pozwala na zapoznanie si z najwaniejszymi krokami analizy, powszechnie stosowanymi potokami analitycznymi i moliwymi zastosowaniami.', '1. Wprowadzenie do systemu Linux.\r\n2. Bazy danych.\r\n3. Detekcja miejsc wystpowania wiza Biako-DNA z wykorzystaniem ChIP-Seq.\r\n4. Wyszukiwanie motyww sekwencji w miejscach wizania biaek z DNA.\r\n5. Wizualizacja danych (IGV).\r\n6. Analiza stanu chromatyny: modyfikacje histonw.\r\n7. Zwikszenie dokadnoci detekcji miejsc wystpowania wiza Biako-DNA przy pomocy techniki ChIP-exo.\r\n8. Projekt - efektywna praca z plikami w formatach powszechnie uywanych w pracy z danymi ChIP-Seq.', 'Ten wprowadzajcy kurs skierowany jest do kadego, kto chce si dowiedzie, jak analizowa dane ChIP-Seq pod ktem konkretnych pyta biologicznych. Kurs jest dostosowany do osb prowadzcych badania w dziedzinach biotechnologii, biologii molekularnej, bioinformatyki i innych nauk biologicznych.', 'Po ukoczeniu kursu uczestnicy powinni posiada wiedz o podstawowych rdach danych ChIP-Seq oraz ChIP-exo i formatach danych wykorzystywanych powszechnie w trakcie analiz. Uczestnicy powinni umie samodzielnie wykona analiz polegajc na wykrywaniu miejsc interakcji DNA i biaek, w tym czynnikw transkrypcyjnych i histonw, a take potrafi wyszukiwa motywy charakterystyczne dla tyche stref wizania. Zwrcimy szczegln uwag na wizualizacj danych w przegldarce genomowej, interpretacj wynikw i radzenie sobie z problemami czsto spotykanymi podczas analizy tego rodzaju danych.', 'Kurs odbdzie si w terminie wskazanym po lewej stronie przycisku \"Zarejstruj si\" w formie webinarium. Wymagane jest posiadanie komputera z systemem Windows, Linux lub Mac OS posiadajcego dostp do internetu. Organizator zastrzega sobie prawo do odwoania kursu nie pniej ni na dwa tygodnie przed dat jego rozpoczcia w przypadku mniej ni 5 uczestnikw.', 'polski', 0x6afdad0a78f49d6de0eefa70f7b5b32187b75aaea6ed8c0110731d27b15584aae795edc062766626bb708380537cf7f23f9394d97ad8298391d01a7737bc3154a9a418c52c494991182ae037e384ee59548caea83f9020d7fa885dd133542058);

